(5245, 'en', 'default', '332b15d44819a94ca8cf34d6a45f2470', 'About Yourself', NULL, NULL, 'LINE', NULL, 10, '', '677523ce1569641b0ac6a11fa5f5e997', NULL, ''),
(5246, 'en', 'default', '8189aa9ed399db1a1afba21e1b8d9598', 'About the user', NULL, NULL, 'LINE', NULL, 10, '', '1eb76d05237618ba93d1cc16a3960285', NULL, ''),
(5247, 'en', 'default', '77f38b54f3a8eec7896a4b2cef0b4e6a', 'Accessibility Ready', NULL, NULL, 'LINE', NULL, 10, '', 'b18f598808be53b2339611fd37a0466c', NULL, ''),
(5248, 'en', 'default', '09f0c5159c5e34504e453eff3fc70324', 'Account Management', NULL, NULL, 'LINE', NULL, 10, '', '216a8e420389bb799b73ad60b8925a10', NULL, ''),
