(5842, 'en', 'default', '8c6da47c770c7fba0d471e56e4ea17cb', 'Hover or tap to see Activate and Live Preview buttons', NULL, NULL, 'LINE', NULL, 10, '', '1e888a7feab476eef0032f48e613b85e', NULL, ''),
(5843, 'en', 'default', '324a8e205fd6e1ed56142378c52931a8', 'Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:', NULL, NULL, 'LINE', NULL, 10, '', 'fec1189b4b1f2a26e07f6552c036bacd', NULL, ''),
(5844, 'en', 'default', '40aa7c670adcc53d50a2eb0d9f434b57', 'Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:', NULL, NULL, 'LINE', NULL, 10, '', '6f27db27336dac372eb7553c49122b5b', NULL, ''),
(5845, 'en', 'default', '632c0917647dd5a8d9d2d13fd0a50715', 'Hovering over a row reveals action links: Edit, Delete Permanently, and View. Clicking Edit or on the media file&#8217;s name displays a simple screen to edit that individual file&#8217;s metadata. Clicking Delete Permanently will delete the file from the media library (as well as from any posts to which it is currently attached). View will take you to the display page for that file.', NULL, NULL, 'LINE', NULL, 10, '', '23728fec8d33e5d227e28bc54683c37a', NULL, ''),
(5846, 'en', 'default', 'c6701576b0781a015b3e4de713ec1078', 'How to Update', NULL, NULL, 'LINE', NULL, 10, '', 'a9e00d6f73298647183d6dad93001f27', NULL, ''),
(5847, 'en', 'default', '83218ac34c1834c26781fe4bde918ee4', 'Welcome', NULL, NULL, 'LINE', NULL, 10, 'Howdy', '38b4afe159bbb459ecb755ceb6025d61', NULL, ''),
(5848, 'en', 'default', 'c225085d6572d117fe4d677b76e52312', 'Howdy ###USERNAME###,\\n\\nYou recently clicked the \'Delete Site\' link on your site and filled in a\\nform on that page.\\n\\nIf you really want to delete your site, click the link below. You will not\\nbe asked to confirm again so only click this link if you are absolutely certain:\\n###URL_DELETE###\\n\\nIf you delete your site, please consider opening a new site here\\nsome time in the future! (But remember your current site and username\\nare gone forever.)\\n\\nThanks for using the site,\\nWebmaster\\n###SITE_NAME###', NULL, NULL, 'LINE', NULL, 10, '', '6f2fbe189c44ab8d50a5c0dfd718502f', NULL, ''),
(5849, 'en', 'default', '6ac9551847a5df4e8a6ce78dcea1ae5b', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the administration email address on\\nyour site changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, 'LINE', NULL, 10, '', 'f8d4ed8542927878c766489d9084fda3', NULL, ''),
(5850, 'en', 'default', '6df497141294a21767ee39060b813331', 'Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.', NULL, NULL, 'LINE', NULL, 10, '', '4306b2d6e77cb1136bb70913a0645764', NULL, ''),
(5851, 'en', 'default', 'c3eb5c3b9018d75cb7032deb99fe43e9', 'I understand', NULL, NULL, 'LINE', NULL, 10, '', 'e61852452bcf81c58f9a08188d682c36', NULL, ''),
(5852, 'en', 'default', '9b2d6dacdbdba224f9f7dc6c968ab5a3', 'I\'m sure I want to permanently disable my site, and I am aware I can never get it back or use %s again.', NULL, NULL, 'LINE', NULL, 10, '', '7aae030e06866a2b0f67963e6c2383f9', NULL, ''),
(5853, 'en', 'default', '4a926cbb9786f9f4675219399a94117c', 'ID #%1$s: %2$s', NULL, NULL, 'LINE', NULL, 10, '', 'ae9c27136845d60ba1e5f5743ba422f9', NULL, ''),
(5854, 'en', 'default', '5f4b530b469120e9be0cf59f0d3dc0ee', 'ID #%1$s: %2$s <strong>Sorry, you are not allowed to remove this user.</strong>', NULL, NULL, 'LINE', NULL, 10, '', '182ebe73f6a20949b0a98b94cbbe8194', NULL, ''),
(5855, 'en', 'default', '9a46cd4d76954006e65738f28615c79d', 'ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>', NULL, NULL, 'LINE', NULL, 10, '', '19d360fdc861b80fb3f89c3ad89ffdb6', NULL, ''),
(5856, 'en', 'default', '73b306231571285f343a324fc21e2242', 'Identicon (Generated)', NULL, NULL, 'LINE', NULL, 10, '', '3c8089a94f4a20179544b8d161592bb9', NULL, ''),
(5857, 'en', 'default', 'f0b044a6cf173afd1a33d8b2ccb31307', 'If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.', NULL, NULL, 'LINE', NULL, 10, '', '1971f6ac2a430e12344f4e1c23130b14', NULL, ''),
(5858, 'en', 'default', '413ea0a127a3a100b83ec95eacabc6c3', 'If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.', NULL, NULL, 'LINE', NULL, 10, '', '27b11d9c8aed915251b6af3836623b77', NULL, ''),
(5859, 'en', 'default', '6f363b449d599453089e76b5b75a84d2', 'If desired, WordPress will automatically alert various services of your new posts.', NULL, NULL, 'LINE', NULL, 10, '', 'fbbda771c29199a924ff990070d6e9ef', NULL, ''),
(5860, 'en', 'default', 'f729908be92047ec1a286f75adf9deac', 'If for any reason this automatic file creation doesn&#8217;t work, don&#8217;t worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.', NULL, NULL, 'LINE', NULL, 10, '', 'ad8149092455db3ba2b501ed0ccb8bd3', NULL, ''),
(5861, 'en', 'default', '37a24e605a3cda57698e531f125740bc', 'If something goes wrong with a plugin and you can&#8217;t use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.', NULL, NULL, 'LINE', NULL, 10, '', 'b9b8f473d110eff046e9836bde623ed6', NULL, ''),
(5862, 'en', 'default', '1dca8bf32d5cff060d7121ae1eb92dfb', 'If the importer you need is not listed, <a href=\"%s\">search the plugin directory</a> to see if an importer is available.', NULL, NULL, 'LINE', NULL, 10, '', '1d1e3e79250e432f39f301f281556562', NULL, ''),
(5863, 'en', 'default', '6d97a8f754ce990eb3882f525df23c36', 'If the link is to a person, you can specify your relationship with them using the above form. If you would like to learn more about the idea check out <a href=\"http://gmpg.org/xfn/\">XFN</a>.', NULL, NULL, 'LINE', NULL, 10, '', 'c1fa83f4e76e574cfcce7b451bc32d30', NULL, ''),
(5864, 'en', 'default', '1433ef9097a488fa699b6908d1bcf7da', 'If the root directory of your site was <a href=\"%1$s\">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %2$s file. Create a new file, called %2$s in the root directory of your site. Click in the field and press %3$s to select all. Then insert this code into the %2$s file.', NULL, NULL, 'LINE', NULL, 10, '', 'a02f2f23099189e7886248ee6265d461', NULL, ''),
(5865, 'en', 'default', 'd9dff3fdbe97394dbe242685a2baaddf', 'If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.', NULL, NULL, 'LINE', NULL, 10, '', 'b29b7284479d958fc9d549fee1073e52', NULL, ''),
(5866, 'en', 'default', 'd20b0e79f5524d5b219510197ef8ab8e', 'If you are looking to use the link manager, please install the <a href=\"%s\">Link Manager</a> plugin.', NULL, NULL, 'LINE', NULL, 10, '', 'b42c749b343c939dbe2576b189c6eb5f', NULL, ''),
(5867, 'en', 'default', '3219753c0cb134607b3205b5f612186e', 'If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.', NULL, NULL, 'LINE', NULL, 10, '', '1b6f257b01e6981375dc758a3199ab63', NULL, ''),
(5868, 'en', 'default', 'ce6795178b70755466ea7df40c7b2555', 'If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.', NULL, NULL, 'LINE', NULL, 10, '', '874f0dfb78167b85a8bcf0569d1ba576', NULL, ''),
(5869, 'en', 'default', '916912d32e90632f29686f67c773ffc8', 'If you do not remember your credentials, you should contact your web host.', NULL, NULL, 'LINE', NULL, 10, '', '4c58dd19bae079e039dc0383aa4b96d8', NULL, ''),
(5870, 'en', 'default', '3cf74bde548a1b8deecb0a49d9de3784', 'If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.', NULL, NULL, 'LINE', NULL, 10, '', 'a11453a281985b76a8a3878322b0a388', NULL, ''),
(5871, 'en', 'default', 'c7b428708659c3c01c911d65bb3ebe23', 'If you don&#8217;t want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.', NULL, NULL, 'LINE', NULL, 10, '', 'd40e2cf9e52c77edd1824c1dd7db77b9', NULL, ''),
(5872, 'en', 'default', '630df4be582006585fc90ce4b93f9254', 'If you don&lsquo;t want to upload your own image, you can use one of these cool headers, or show a random one.', NULL, NULL, 'LINE', NULL, 10, '', '670f09b60167f2151c58a9aac9220ebf', NULL, ''),
(5873, 'en', 'default', '62c4541e6538f354865d8026c67d446e', 'If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.', NULL, NULL, 'LINE', NULL, 10, '', 'eeb98b73b769919deb0e8a7cb490efea', NULL, ''),
(5874, 'en', 'default', '3e0109b6197e41063cfac796836f2dad', 'If you have a plugin in a .zip format, you may install it by uploading it here.', NULL, NULL, 'LINE', NULL, 10, '', 'e095159d4751cb7d3f7fb57962f8b003', NULL, ''),
(5875, 'en', 'default', '499ba6a1e9428f7283cd1405774270d1', 'If you have a theme in a .zip format, you may install it by uploading it here.', NULL, NULL, 'LINE', NULL, 10, '', 'b0325cbc30aaa9852894a4fd7f344d8e', NULL, ''),
(5876, 'en', 'default', '62f7387a9ef151c294e680b2fd42169e', 'If you have marked plugins as favorites on WordPress.org, you can browse them here.', NULL, NULL, 'LINE', NULL, 10, '', 'b8fec56cb45e1a17dc0a62f2b168910f', NULL, ''),
(5877, 'en', 'default', '7292a018caf8f27efeec3ee8fdaea12d', 'If you have marked themes as favorites on WordPress.org, you can browse them here.', NULL, NULL, 'LINE', NULL, 10, '', '4e181b871f87a1027dd5942943ef34ea', NULL, ''),
(5878, 'en', 'default', '8ba5adc334d2585a8a27cc06d82e8a3f', 'If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:', NULL, NULL, 'LINE', NULL, 10, '', '02495c0abfdb5ea16804a08a9c3efe8a', NULL, '');
INSERT INTO `arch_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES
(5879, 'en', 'default', 'c5ecefc2c05db6570556c7385ac2e8a3', 'If you haven&#8217;t yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started', NULL, NULL, 'LINE', NULL, 10, '', 'e3750bb5eb2eb05b624dbab6c20b5e59', NULL, ''),
(5880, 'en', 'default', '2448f34ad2e38271ffbcf4d299c17c5d', 'If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.', NULL, NULL, 'LINE', NULL, 10, '', '575aca988849707fdbbfd60be15902e1', NULL, ''),
(5881, 'en', 'default', 'a379ef32870b64a6ef175d6e3da0bf17', 'If you know what you&#8217;re looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.', NULL, NULL, 'LINE', NULL, 10, '', '2dfd3ebb5bbf8256c5c0cc8fefb8b3c8', NULL, ''),
(5882, 'en', 'default', '864e67dda7ff0dc96db5c841bdbf98ad', 'If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.', NULL, NULL, 'LINE', NULL, 10, '', 'd635a782b4c7393661373e724751b36c', NULL, ''),
(5883, 'en', 'default', '837a1e84e411703eb806ddee77465493', 'If you need to re-install version %s, you can do so here:', NULL, NULL, 'LINE', NULL, 10, '', '05757d13169fcca8a5f39dae14249346', NULL, ''),
(5884, 'en', 'default', '1a89b9744e617ef3fb4ab7c4fffee90c', 'If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.', NULL, NULL, 'LINE', NULL, 10, '', '8a085eced0d0591c402c82cff68cbc18', NULL, ''),
(5885, 'en', 'default', '97b78ef138769a3fcf7e03efeafe2005', 'If you reach out to us, we\'ll also ensure you\'ll never have this problem again.', NULL, NULL, 'LINE', NULL, 10, '', 'cea417fb3ad33a8c6e47bd88db6f8df1', NULL, ''),
(5886, 'en', 'default', 'b1547fa31c5744e25be92a64e7f77beb', 'If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.', NULL, NULL, 'LINE', NULL, 10, '', '08cbe037e394e47b4dc740a5ae61ce70', NULL, ''),
(5887, 'en', 'default', '12c31c3cb7ab49899ec2e979d5a553f5', 'If you temporarily make your %s file writable for us to generate rewrite rules automatically, do not forget to revert the permissions after rule has been saved.', NULL, NULL, 'LINE', NULL, 10, '', 'fbfb20c605ce87bf0b18c0013694071e', NULL, ''),
(5888, 'en', 'default', 'a98ef57dff34e18723548ccd8a286c59', 'If you temporarily make your site&#8217;s root directory writable for us to generate the %s file automatically, do not forget to revert the permissions after the file has been created.', NULL, NULL, 'LINE', NULL, 10, '', '55f26516c6be022a2bae7e814fdb1559', NULL, ''),
(5889, 'en', 'default', 'efe517a5b918a12ecb7dfd17f3877327', 'If you want site visitors to be able to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.', NULL, NULL, 'LINE', NULL, 10, '', '1e0104cd42ac1e2fe540ba466d5ff248', NULL, ''),
(5890, 'en', 'default', 'e8953b095643b4bf6a1cd0bae7a85508', 'If you want to convert your categories to tags (or vice versa), use the <a href=\"%s\">Categories and Tags Converter</a> available from the Import screen.', NULL, NULL, 'LINE', NULL, 10, '', '194c0e92da833182de4233fc3786e2b7', NULL, ''),
(5891, 'en', 'default', 'be3d2742b2dbbb1878b22b8702b6e8d7', 'If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.', NULL, NULL, 'LINE', NULL, 10, '', '313943fe8cc1a3d691aa966a6a6819c7', NULL, ''),
(5892, 'en', 'default', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', NULL, NULL, 'LINE', NULL, 10, '', '8c4742c33256ee314435258e3a200070', NULL, ''),
(5893, 'en', 'default', 'fc276f47f9e88e53fb9a81e0e683a057', 'If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.', NULL, NULL, 'LINE', NULL, 10, '', 'f5f6f5978f1a37ee120927289f3f6f8d', NULL, ''),
(5894, 'en', 'default', 'b54fa9afe2dc888d8a5c71cc1b61b51c', 'If you want to run multiple WordPress installations in a single database, change this.', NULL, NULL, 'LINE', NULL, 10, '', '7ed16a5d29814e6517b04e35979dbb8c', NULL, ''),
(5895, 'en', 'default', 'ce99e8b4ddb1935ad216af170d465663', 'If you would like to see more plugins to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional plugins from the <a href=\"%s\">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, NULL, 'LINE', NULL, 10, '', '918021f3c1c7333bbb985975acdf69b3', NULL, ''),
(5896, 'en', 'default', 'ff1e9b8584871613da97bf909bf0d3d4', 'If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href=\"%s\">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, NULL, 'LINE', NULL, 10, '', '85b7f40dae14e2dedd2d051b8da068b4', NULL, ''),
(5897, 'en', 'default', '5074f6b262894aae8f6923d7ff9eadf1', 'If your %1$s file was <a href=\"%2$s\">writable</a>, we could do this automatically, but it isn&#8217;t so these are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s to select all.', NULL, NULL, 'LINE', NULL, 10, '', '0651b69befec7bf871bf4d593b4eb1cf', NULL, ''),
(5898, 'en', 'default', '93f3cd2b6a8fda8223f25e6fd0f47db4', 'If your %1$s file was <a href=\"%2$s\">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %1$s file. Click in the field and press %3$s to select all. Then insert this rule inside of the %4$s element in %1$s file.', NULL, NULL, 'LINE', NULL, 10, '', '4768687268baff9591b17ec71c06e3d6', NULL, ''),
(5899, 'en', 'default', 'ae4333ffddf970f98ea2387193cc0f5b', 'If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.', NULL, NULL, 'LINE', NULL, 10, '', 'aad695b974325b8e604c6a490dbf8754', NULL, ''),
(5900, 'en', 'default', '86e33eeb24e5a62590ead9de8238c36c', 'Image Address', NULL, NULL, 'LINE', NULL, 10, '', 'a0b6958e2893def21db5825e2c37618c', NULL, ''),
(5901, 'en', 'default', 'f1daa5de35312c743db4bba47fa4e3a5', 'Image Attachment Template', NULL, NULL, 'LINE', NULL, 10, '', '27a67adec0d5dc34dd2623dbfeeee87c', NULL, ''),
(5902, 'en', 'default', '4c6ace7405819bffddf7ee5133db4201', 'Image Caption', NULL, NULL, 'LINE', NULL, 10, '', '07976d81adde1eb0a9e2cf357de72a9f', NULL, ''),
(5903, 'en', 'default', '2616a81775263adf3a6222d35513e15a', 'Image Crop', NULL, NULL, 'LINE', NULL, 10, '', '058a077b2b7b137f1db8322814327731', NULL, ''),
(5904, 'en', 'default', '31b8ea2b48f332efeaaac75d92bf9596', 'Image Crop Help', NULL, NULL, 'LINE', NULL, 10, '', '84a79cde30df8496b6e78a6d2e84bac2', NULL, ''),
(5905, 'en', 'default', '323126045a230b218de6ebd6a53fb7f8', 'Image File', NULL, NULL, 'LINE', NULL, 10, '', 'a8e1b0470235169b981ca3fe5d5d5f7a', NULL, ''),
(5906, 'en', 'default', '4004a789fa905f7ea15db9c2f91906b5', 'Image Processing Error', NULL, NULL, 'LINE', NULL, 10, '', '4cd03ab760336e61d94f6850fe2cec9f', NULL, ''),
(5907, 'en', 'default', '9d05878add9bf672c019a0553a08cbd9', 'Image Upload Error', NULL, NULL, 'LINE', NULL, 10, '', 'eea1d43c2efda3106ecc7bba368eae1e', NULL, ''),
(5908, 'en', 'default', '59332018a4582cae903701e42728f002', 'Image could not be processed.', NULL, NULL, 'LINE', NULL, 10, '', '892363154fbfd06c954d9d19261bdae8', NULL, ''),
(5909, 'en', 'default', '5c67704f232067ca9fdae2794b596986', 'Image could not be processed. Please go back and try again.', NULL, NULL, 'LINE', NULL, 10, '', 'ee1f96608779e88eb6bba954e5e8e94d', NULL, ''),
(5910, 'en', 'default', '6ac3e4db810decc75cb5f49065e02ead', 'Image data does not exist. Please re-upload the image.', NULL, NULL, 'LINE', NULL, 10, '', '1de10171e664c0f2322bf883f5fd4748', NULL, ''),
(5911, 'en', 'default', '59969adb3ff5274577d2b7ce23eae5c7', 'Image metadata is inconsistent.', NULL, NULL, 'LINE', NULL, 10, '', '17c5b8919ff4f924a3efa2b294295e91', NULL, ''),
(5912, 'en', 'default', 'ec71bab863e85a2afdf09a72b05efa1f', 'Image restored successfully.', NULL, NULL, 'LINE', NULL, 10, '', '3e7dc8c4e77840262f5b9a46ea54292b', NULL, ''),
(5913, 'en', 'default', 'cc574ecc52f326293633a74d548e9c27', 'Image rotation is not supported by your web host.', NULL, NULL, 'LINE', NULL, 10, '', 'f27fd855564ff3f6d9e811cf289a2308', NULL, ''),
(5914, 'en', 'default', '6313deda4940bdd2f937bc94ba24774e', 'Image saved', NULL, NULL, 'LINE', NULL, 10, '', '6519900374972f38fd7ea72a9837a648', NULL, ''),
