(6222, 'en', 'default', 'cf58d0bdb1a7290be283d6eecf7ae494', 'Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.', NULL, NULL, 'LINE', NULL, 10, '', '5e17346941e1c3c5429df2cd864628f8', NULL, ''),
