(6608, 'en', 'default', 'eb75d61c0d32edf7f02ac4b9245e9066', 'Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.', NULL, NULL, 'LINE', NULL, 10, '', '6f6504bc3b2a415851941dc76f520261', NULL, ''),
(6609, 'en', 'default', '6270d2d0bd4ea283cd688cee5979a257', 'Taxonomy Template', NULL, NULL, 'LINE', NULL, 10, '', 'e65bfb983d96c661a3fd4b5f50be0e6a', NULL, ''),
(6610, 'en', 'default', '8903861290617267b361478ab7f16f31', 'Text Color', NULL, NULL, 'LINE', NULL, 10, '', '016151ec467205b59df6d1731f45a8a6', NULL, ''),
(6611, 'en', 'default', '6f3dfb9b486505e02c34ff3f5f28c3da', 'Thank you for Updating! Please visit the <a href=\"%s\">Upgrade Network</a> page to update all your sites.', NULL, NULL, 'LINE', NULL, 10, '', '0bef3c48618fe1470758e2a5f2b75daf', NULL, ''),
(6612, 'en', 'default', '0b140a27ead4284f8c21c555351383be', 'Thank you for updating to the latest version! WordPress %s will smooth your design workflow and keep you safe from coding errors.', NULL, NULL, 'LINE', NULL, 10, '', 'f0a0a7731dd87117993d4a70406d9839', NULL, ''),
(6613, 'en', 'default', '92a7784fc2dce98ad5eb3ca9a5f87c42', 'Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.', NULL, NULL, 'LINE', NULL, 10, '', '35e693580ea9ba889cf082c6e5124f71', NULL, ''),
(6614, 'en', 'default', '286151a15b172f69875a61e94727075d', 'Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.', NULL, NULL, 'LINE', NULL, 10, '', 'db4ca56410ce7dee44f0b7e126963333', NULL, ''),
(6615, 'en', 'default', 'a056acb19936fc9e7d3764e4214c8702', 'That user could not be added to this site.', NULL, NULL, 'LINE', NULL, 10, '', '80fcc4dba08e620d0c2e2015fe4f6907', NULL, ''),
