(6622, 'en', 'default', '5ec28895290332887fc333d6c2370a11', 'The %s stylesheet doesn&#8217;t contain a valid theme header.', NULL, NULL, 'LINE', NULL, 10, '', 'f84d7430293b520df3b1a5839a60433c', NULL, ''),
(6623, 'en', 'default', '77aba6400a12368a3c8e1d29765352b2', 'The %s table is already optimized.', NULL, NULL, 'LINE', NULL, 10, '', 'acda4c605adf6c549fe548e1eba474e9', NULL, ''),
(6624, 'en', 'default', '744a1d8f5bfbd4c6d90923b7087343f7', 'The %s table is okay.', NULL, NULL, 'LINE', NULL, 10, '', '99653af0aeab8b08889b6223b7a8e7d4', NULL, ''),
(6625, 'en', 'default', 'e0433c8fccacdcc1dec538d01a5ffb07', 'The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, NULL, 'LINE', NULL, 10, '', 'c84042caac8257ad95bc00faf92e0b6f', NULL, ''),
(6626, 'en', 'default', 'b30e060516ec005fae3a7bedfef38b28', 'The <a href=\"https://codex.wordpress.org/Glossary#Character_set\">character encoding</a> of your site (UTF-8 is recommended)', NULL, NULL, 'LINE', NULL, 10, '', 'd16310ea3f78928cd3b670b6bedba9d4', NULL, ''),
(6627, 'en', 'default', '554b7ac84f1fa573ee1867a3a2c02d09', 'The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.', NULL, NULL, 'LINE', NULL, 10, '', 'c870042c568c84af431c05479fe39260', NULL, ''),
(6628, 'en', 'default', '2f1a8ec3a8b277b002ea5dd3a9c166ec', 'The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.', NULL, NULL, 'LINE', NULL, 10, '', '73e9ba17e991f5898b5f2b0737c9ad4c', NULL, ''),
(6629, 'en', 'default', '1e2ad5c78a6bba9e430dc771728a358c', 'The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements.', NULL, NULL, 'LINE', NULL, 10, '', '663621b6d079f8703d5e4a7c2aab713b', NULL, ''),
(6630, 'en', 'default', '88dc13179c52b8083ec73e317b2d5338', 'The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.', NULL, NULL, 'LINE', NULL, 10, '', 'f53280634c7e03c2413c208d3e3e68b2', NULL, ''),
(6631, 'en', 'default', '3381f3479f10d0412df7ce542b32b439', 'The New Gallery Widget', NULL, NULL, 'LINE', NULL, 10, '', '8e113e03b8ebc674c2009ec2d000fe6b', NULL, ''),
(6632, 'en', 'default', 'e3a6c830a45973f8caac3432d436e903', 'The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.', NULL, NULL, 'LINE', NULL, 10, '', 'c686ed3a11e088be1973308ebe9e40cb', NULL, ''),
(6633, 'en', 'default', '2bc6f983917576292a23bcbf9c5ecf74', 'The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.', NULL, NULL, 'LINE', NULL, 10, '', '6822422cfd888b5560ab16ce486fcf0f', NULL, ''),
(6634, 'en', 'default', '62457c7b06e9492db136c612087a8636', 'The Theme Installer screen requires JavaScript.', NULL, NULL, 'LINE', NULL, 10, '', 'ee81cae6fee978a72094c23881080975', NULL, ''),
(6635, 'en', 'default', 'fa7710958d9308b31dfb35c7cd561c36', 'The Walker class named %s does not exist.', NULL, NULL, 'LINE', NULL, 10, '', '34054a8dc59b2133208d8c72fc61addb', NULL, ''),
(6636, 'en', 'default', '002b9dd3a4beb56d4092b6848925ba55', 'The WordPress Team', NULL, NULL, 'LINE', NULL, 10, '', '07bb812d2f3b5981c5bbf4c67a763730', NULL, ''),
(6637, 'en', 'default', '68804ce6aa38ab1ef7d4e33889033f7b', 'The WordPress URL and the Site URL can be the same (example.com) or different; for example, having the WordPress core files (example.com/wordpress) in a subdirectory instead of the root directory.', NULL, NULL, 'LINE', NULL, 10, '', '611f402fad36bf6c2938669e03586d18', NULL, ''),
(6638, 'en', 'default', 'be7027f369951f13e70f11596d6f5328', 'The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.', NULL, NULL, 'LINE', NULL, 10, '', '3d2e5149e2f489b217865e5abac9d14c', NULL, ''),
(6639, 'en', 'default', '462d9bb1638287143d47e551f189f362', 'The active theme is broken. Reverting to the default theme.', NULL, NULL, 'LINE', NULL, 10, '', 'ee82ecbf9e622270887b544c8c70c8ba', NULL, ''),
(6640, 'en', 'default', '0d6e6952823baa88591bf01e4b2a7d9f', 'The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.', NULL, NULL, 'LINE', NULL, 10, '', '26728d76bfe1ad7865f61289e45209ca', NULL, ''),
(6641, 'en', 'default', '61b6cf804dc77479ab0d352e1a3a7680', 'The backup of this post in your browser is different from the version below.', NULL, NULL, 'LINE', NULL, 10, '', 'ca27f1a29261c8d6c56c7a2e2a50ace0', NULL, ''),
(6642, 'en', 'default', 'ea7e6216c8e195c3ee86ef1f9a50b954', 'The boxes for link name, web address, and description have fixed positions, while the others may be repositioned using drag and drop. You can also hide boxes you don&#8217;t use in the Screen Options tab, or minimize boxes by clicking on the title bar of the box.', NULL, NULL, 'LINE', NULL, 10, '', 'a59d62ea2a4eefeb41bb3ebc3ddf2a6b', NULL, ''),
(6643, 'en', 'default', '7ab07ba8c965ea3d313a005f2b1be7e1', 'The boxes on your Dashboard screen are:', NULL, NULL, 'LINE', NULL, 10, '', '0c233d949e877e2af23f5c041e05bb6b', NULL, ''),
