(6650, 'en', 'default', '5602c5c8e3e0c5a5f08b56faa4f3e32d', 'The database update process may take a little while, so please be patient.', NULL, NULL, 'LINE', NULL, 10, '', '16e88870821776aad4edbada8ac3f9ed', NULL, ''),
(6651, 'en', 'default', 'f5b712b9d301f61dd92249263ecc1e6a', 'The description is not prominent by default; however, some themes may show it.', NULL, NULL, 'LINE', NULL, 10, '', '4d7aff344d157ca85bba08f7fc5d35de', NULL, ''),
(6652, 'en', 'default', '445a3c1fa5bbae94fc96d0ffffd1f03d', 'The dreaded white screen. You&#8217;ll avoid it when working on themes and plugin code because WordPress 4.9 will warn you about saving an error. You&#8217;ll sleep better at night.', NULL, NULL, 'LINE', NULL, 10, '', 'a3d90099b9516eeb50523180b0d2cd98', NULL, ''),
(6653, 'en', 'default', '1283a7fcac8dc097b0875b6a7290af01', 'The fields on this screen determine some of the basics of your site setup.', NULL, NULL, 'LINE', NULL, 10, '', 'da995ca09f039985d226591412a088b0', NULL, ''),
