(6671, 'en', 'default', '030eb735ca4d9aed22505e6adb6e37c1', 'The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.', NULL, NULL, 'LINE', NULL, 10, '', 'a199554e617c102a6467d92c120ed216', NULL, ''),
(6672, 'en', 'default', '6cd5563003ed28586594ce0fd5f3aad5', 'The menu has been successfully deleted.', NULL, NULL, 'LINE', NULL, 10, '', 'd51669c904341744cff82a3c27e8ed89', NULL, ''),
(6673, 'en', 'default', '788ec2933cfc88ce4fbaf52c8378f459', 'The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.', NULL, NULL, 'LINE', NULL, 10, '', '84b1bf93bccd3e3fd3d8b44838df50f0', NULL, ''),
(6674, 'en', 'default', '692aab9220484ce95afd7ad0fb7b5d35', 'The menu item has been successfully deleted.', NULL, NULL, 'LINE', NULL, 10, '', '65ce9fdd715f61c9a6e1c34582a39e5a', NULL, ''),
