(6771, 'en', 'default', 'bb8e5b75c948e9f3b10edc9050c10024', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\\n\\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\\n\\n...or something like this:\\n\\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\\n\\nAs a new WordPress user, you should go to <a href=\"%s\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', NULL, NULL, 'LINE', NULL, 10, '', '0475b5f2695b2d9143d8a26a0a9c8b4a', NULL, ''),
(6772, 'en', 'default', '5443452c7b39d2cf22eb1fc4e86c9ed6', 'This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.', NULL, NULL, 'LINE', NULL, 10, '', '7c20a01d08f28af18023c5635ea2289a', NULL, ''),
