(7000, 'en', 'default', '04f27ee370a16937b3414fabd9537601', 'We&#8217;ve introduced a new code editing library, CodeMirror, for use within core. Use it to improve any code writing or editing experiences within your plugins, like CSS or JavaScript include fields.', NULL, NULL, 'LINE', NULL, 10, '', 'fc106b11f9598b16944b73e2166d52f3', NULL, ''),
(7001, 'en', 'default', '3f1fd28a5e83208f2e13fb5162bcec9d', 'We&#8217;ve made numerous improvements to the Customizer JS API in WordPress 4.9, eliminating many pain points and making it just as easy to work with as the PHP API. There are also new base control templates, a date/time control, and section/panel/global notifications to name a few. <a href=\"%s\">Check out the full list.</a>', NULL, NULL, 'LINE', NULL, 10, '', '3ab0f781146fbfab9151a1fe0e6f2265', NULL, ''),
