(7011, 'en', 'default', '6271c2bddf9d5cd62fe0d0d5138e0372', 'Welcome to WordPress. Before getting started, we need some information on the database. You will need to know the following items before proceeding.', NULL, NULL, 'LINE', NULL, 10, '', '2f8c612c4e0bab717d184e20171e60fd', NULL, ''),
(7012, 'en', 'default', 'ccbf63a83dc5ac46245212ed907c97b2', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', NULL, NULL, 'LINE', NULL, 10, '', '7ce72c34c605c494bf6197781447a85d', NULL, ''),
(7013, 'en', 'default', 'cd61e834ef28051bae99e31d131c100a', 'Welcome to an improved Customizer workflow with design drafts, locking, scheduling, and preview links. What&#8217;s more, code syntax highlighting and error checking will make for a clean and smooth site building experience. Finally, if all that wasn&#8217;t pretty great, we&#8217;ve got a great new Gallery widget and improvements to theme browsing and switching.', NULL, NULL, 'LINE', NULL, 10, '', 'dc333a927a553863a9e96af78504f8ac', NULL, ''),
(7014, 'en', 'default', '1edbf8934455e35e01018196f1aa0a7f', 'Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.', NULL, NULL, 'LINE', NULL, 10, '', 'c8ed12874ebd60ce751ed1d79fa1a1fb', NULL, ''),
(7015, 'en', 'default', '7bb5b05b47216f59eeab4b23d0014277', 'Welcome to your WordPress Dashboard! This is the screen you will see when you log in to your site, and gives you access to all the site management features of WordPress. You can get help for any screen by clicking the Help tab above the screen title.', NULL, NULL, 'LINE', NULL, 10, '', 'caa3ada644015d7da497c61e78d64e63', NULL, ''),
(7016, 'en', 'default', 'c58175f35e1622ed62c19e4e29756c3f', 'Were you confused by the steps to create a new menu? Perhaps no longer! We&#8217;ve ironed out the UX for a smoother menu creation process. Newly updated copy will guide you.', NULL, NULL, 'LINE', NULL, 10, '', 'a9e0bbd008b3e36609e17a8e15d61e11', NULL, ''),
(7017, 'en', 'default', 'd70b95270024295a402c30dc85995616', 'Were you lured away from your desk before you saved your new draft design? Fear not, when you return, WordPress 4.9 will politely ask whether or not you&#8217;d like to save your unsaved changes.', NULL, NULL, 'LINE', NULL, 10, '', '7805e03865ab10f7123d69e64b1767ee', NULL, ''),
(7018, 'en', 'default', '573ee33e6dc0017ff8cea855ba20d94a', 'What should be done with content owned by %s?', NULL, NULL, 'LINE', NULL, 10, '', '2f2fd465cdba012a16edcff844726205', NULL, ''),
(7019, 'en', 'default', 'e8bcf4109800f9a69e2fbe6fbcb536cf', 'What should be done with content owned by these users?', NULL, NULL, 'LINE', NULL, 10, '', '3ba21c5c7b17dfc99bd9649c59d44723', NULL, ''),
(7020, 'en', 'default', 'd88eb4c96e6d1092f492e2779cf0e303', 'What should be done with content owned by this user?', NULL, NULL, 'LINE', NULL, 10, '', 'a53fb6e23ceb62b262625a4351b3e95f', NULL, ''),
(7021, 'en', 'default', '69811f1b0413b571cb45ae1dac8bf159', 'What&#8217;s New', NULL, NULL, 'LINE', NULL, 10, '', '0fddd3884a08c5223e3865eaeaa816b7', NULL, ''),
(7022, 'en', 'default', 'ad0ed139b38e9109a54f54f4ff5b9fdb', 'What&#8217;s on your mind?', NULL, NULL, 'LINE', NULL, 10, '', 'df5b59fbb2d3d8a1388bf001a5108fe6', NULL, ''),
(7023, 'en', 'default', 'a898fa08a0cadfff38577d1a8d36312d', 'What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.', NULL, NULL, 'LINE', NULL, 10, '', '4d97505e61693c0a1aac1b958fe094ac', NULL, ''),
(7024, 'en', 'default', '57be9d8bfc6aa5405ee07e7e6ea8b1db', 'When a comment contains any of these words in its content, name, URL, email, or IP address, it will be held in the <a href=\"edit-comments.php?comment_status=moderated\">moderation queue</a>. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, NULL, 'LINE', NULL, 10, '', '343323210a62576dc544083b735d8e11', NULL, ''),
(7025, 'en', 'default', 'd21b8704fed13b5c39fc8a6550bc3d00', 'When a comment contains any of these words in its content, name, URL, email, or IP address, it will be put in the trash. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, NULL, 'LINE', NULL, 10, '', '5a3725e25fc2fad6528b6af775d54386', NULL, ''),
(7026, 'en', 'default', '16eb38b0466b758e83ffc1afb65bc986', 'When adding a new category on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, 'LINE', NULL, 10, '', '8348240c846a4cb879a67a7a1e6818ca', NULL, ''),
(7027, 'en', 'default', '370c15874bf89814187701866c485c9e', 'When adding a new tag on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, 'LINE', NULL, 10, '', '2c226506d0afbbba1a770a535751b268', NULL, ''),
(7028, 'en', 'default', '7703983ef109c52a423492c4bfa5ffbe', 'When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.', NULL, NULL, 'LINE', NULL, 10, '', 'a4018b4b9fa0ad74ac664770d4fa25bd', NULL, ''),
(7029, 'en', 'default', '91015d74131523d75c8ee1d82db9e132', 'When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.', NULL, NULL, 'LINE', NULL, 10, '', 'ec0c3d224b684a115d955d14d78a3c2b', NULL, ''),
(7030, 'en', 'default', '4210a86ca0a86ebdf5712c60c47a01ca', 'When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search Engines Discouraged,&#8221; to remind you that your site is not being crawled.', NULL, NULL, 'LINE', NULL, 10, '', '33960768ca0efb2109671f1ab02318f6', NULL, ''),
(7031, 'en', 'default', '4fd5e879927f19de076cca45bc59434a', 'When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.', NULL, NULL, 'LINE', NULL, 10, '', 'd70e008926f797f7fa73820eeb9729d4', NULL, ''),
(7032, 'en', 'default', 'cd8d1a19831be7da0547b6a5fcf33156', 'When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes <code>%category%</code> or <code>%tag%</code>.', NULL, NULL, 'LINE', NULL, 10, '', '898670c2e52a88ad0454c93711770605', NULL, ''),
(7033, 'en', 'default', '2a668b1b4a5c8a0d7d6ccc363cf266a7', 'When you click the button below WordPress will create an XML file for you to save to your computer.', NULL, NULL, 'LINE', NULL, 10, '', '3d57ff833f4fae8a369e17d3f5cce00d', NULL, ''),
(7034, 'en', 'default', 'f44439cfd9036b3d7d9ebabf77e4454c', 'When you edit themes and plugins directly, WordPress 4.9 will politely warn you that this is a dangerous practice. It will recommend that you backup your files before saving, so they don&#8217;t get overwritten by the next update. Take the safe route: your future self will thank you. Your team and customers will thank you.', NULL, NULL, 'LINE', NULL, 10, '', '5ef97653ebcd956d1e4c50dc96e43758', NULL, ''),
(7035, 'en', 'default', '1d7b8a30c545e74f35989943383cf0ca', 'When you publish a new post, WordPress automatically notifies the following site update services. For more about this, see <a href=\"%s\">Update Services</a> on the Codex. Separate multiple service URLs with line breaks.', NULL, NULL, 'LINE', NULL, 10, '', '74a6be1a7662948445cd005231dd2d0e', NULL, ''),
(7036, 'en', 'default', '191ec6e58017ed5fc068a91b2604e54e', 'When you switch themes, widgets sometimes think they can just up and move location. Improvements in WordPress 4.9 offer more persistent menu and widget placement when you decide it&#8217;s time for a new theme. Additionally, you can preview installed themes or download, install, and preview new themes right. Nothing says handy like being able to preview before you deploy. ', NULL, NULL, 'LINE', NULL, 10, '', '19d47f8ab3155708d972bb8b201db27d', NULL, ''),
(7037, 'en', 'default', 'a038eafad9e01988c1841de565372b3d', 'While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href=\"%2$s\">WordPress.org secret key service</a>.', NULL, NULL, 'LINE', NULL, 10, '', '8b4c653c9278b9bdbfe1b5afec5a7663', NULL, ''),
(7038, 'en', 'default', '4164b9aab2478e48463a5e400b5918b3', 'While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, your site will return to normal.', NULL, NULL, 'LINE', NULL, 10, '', 'ef84fcea94cffcfd5220edc6c0a912f0', NULL, ''),
(7039, 'en', 'default', '06d67eb99ad329dc01617be9f85c4d63', 'Widget %s', NULL, NULL, 'LINE', NULL, 10, '', '58861891ba33200d0f243c26143a5fc6', NULL, ''),
(7040, 'en', 'default', '5f71bda8d746f5a38f8be090639b5e2f', 'Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.', NULL, NULL, 'LINE', NULL, 10, '', '2628ac04367ef5339322e23a38240fb5', NULL, ''),
(7041, 'en', 'default', '2a1b56a60634250cd6cf205c74ed00c6', 'Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.', NULL, NULL, 'LINE', NULL, 10, '', 'cb26d608dcaf5e53bfdccbb076ee7f6b', NULL, ''),
(7042, 'en', 'default', '2dcde0b29a51130f79f23dee3acbe2ed', 'Word count: %s', NULL, NULL, 'LINE', NULL, 10, '', 'b71bc0ddcb133c472c9ea1793eeba84c', NULL, ''),
