(7049, 'en', 'default', '5bbf9d416b03effde536408f99112214', 'WordPress &rsaquo; Installation', NULL, NULL, 'LINE', NULL, 10, '', '51913721d4a164ce42d49c8caeda403e', NULL, ''),
(7050, 'en', 'default', '03552ef30df215d8c1f6fc80a22604ae', 'WordPress &rsaquo; Setup Configuration File', NULL, NULL, 'LINE', NULL, 10, '', '814b10c0c658bc4d003207fc97e472d3', NULL, ''),
