(8329, 'en', 'default', '36ce374000d338cd986460ce312bcae5', 'In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.', NULL, NULL, 'LINE', NULL, 10, '', '3ee9c2dd60584a7dde9b3eda4294c2d0', NULL, ''),
(8330, 'en', 'default', '16a7d315d4eb5e71cf53bd119764f2a6', 'The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.', NULL, NULL, 'LINE', NULL, 10, '', '1309f621bd0055cd2c9d869996990f0c', NULL, ''),
(8331, 'en', 'default', '60c69c85078faab94c4ad122825e041b', 'Our website address is: %s.', NULL, NULL, 'LINE', NULL, 10, '', '9864bae3e2831914ba049efb8e2e3b08', NULL, ''),
(8332, 'en', 'default', 'a9db3b2eaf00fc9d72b684237b8c004f', 'What personal data we collect and why we collect it', NULL, NULL, 'LINE', NULL, 10, '', '124ca84a9d92a67152c96ca3e975ac7d', NULL, ''),
(8333, 'en', 'default', 'afb5c651f25a99fe9dea21458989b965', 'In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.', NULL, NULL, 'LINE', NULL, 10, '', '55364a8c7c34dcaec179a49ce5feb8ac', NULL, ''),
(8334, 'en', 'default', '2b0bb6f25d9c926d8717eae9d9a94454', 'You should also note any collection and retention of sensitive personal data, such as data concerning health.', NULL, NULL, 'LINE', NULL, 10, '', 'cf565abf2a4b72a4ba7401b2f229d7b4', NULL, ''),
(8335, 'en', 'default', 'ac9a4d2e8722460793b93d7d7ceeb7a5', 'In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.', NULL, NULL, 'LINE', NULL, 10, '', 'adcb013b4f3ca5b3df135d1b9f0798fb', NULL, ''),
(8336, 'en', 'default', '61ea2b8d21fe2e4df2247f0680579024', 'Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.', NULL, NULL, 'LINE', NULL, 10, '', '9a4977aaf3242145fdb1214580d78be8', NULL, ''),
(8337, 'en', 'default', 'a4de3012edb9e615cba657b2fb29dd24', 'By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.', NULL, NULL, 'LINE', NULL, 10, '', 'eec5f990e54f0d488c9668381d51ec1c', NULL, ''),
(8338, 'en', 'default', 'b619d7c9609b9d7b1ca3e6bfbcf5309e', 'In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.', NULL, NULL, 'LINE', NULL, 10, '', 'cdf36a9314632abfed28786bb7267047', NULL, ''),
(8339, 'en', 'default', 'b18d07e59a875a4350e8cfa10509c5d7', 'When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.', NULL, NULL, 'LINE', NULL, 10, '', 'da2d58e7f047ffb8843c16d6ddf10432', NULL, ''),
(8340, 'en', 'default', '5bf0318ac2be1384d56f30c969c0220d', 'An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.', NULL, NULL, 'LINE', NULL, 10, '', 'fbae205b13903785c133763abea985cd', NULL, ''),
(8341, 'en', 'default', 'ec27ccde34cd289565d2db48b580f59b', 'In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.', NULL, NULL, 'LINE', NULL, 10, '', '2c605f73abd62a98d1527efab250fad6', NULL, ''),
(8342, 'en', 'default', '64771a7ce98863e88b3b4e2c1448f6d0', 'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.', NULL, NULL, 'LINE', NULL, 10, '', '69ef71fb437c6bf62fc83a4ccf0f54b5', NULL, ''),
(8343, 'en', 'default', '0c7b687f084390a829fa8565b3096029', 'Contact forms', NULL, NULL, 'LINE', NULL, 10, '', '3a8f1f1123b64bb049198019beed2706', NULL, ''),
(8344, 'en', 'default', 'bdcc5a96190089ab92a53a42910fc9d7', 'By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.', NULL, NULL, 'LINE', NULL, 10, '', '2f597e938edf13361bdf1cde1770b525', NULL, ''),
(8345, 'en', 'default', '597b56e53847cd6a4712ac183f61fa68', 'Cookies', NULL, NULL, 'LINE', NULL, 10, '', 'dfb4c3735daecf9a7310dc58a2e575f8', NULL, ''),
(8346, 'en', 'default', 'ca3d5159accd9468729ea6a9aef4d58e', 'In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.', NULL, NULL, 'LINE', NULL, 10, '', 'a7aa56fcc29c49d74ac60bfadbb28ae7', NULL, ''),
(8347, 'en', 'default', 'b642d452dd24b19ed95b29d92e97240d', 'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.', NULL, NULL, 'LINE', NULL, 10, '', 'd794b6153c4a4b8146e4b05cafb43a27', NULL, ''),
(8348, 'en', 'default', 'cd7b8cf1cfc4fb579df5f63f419c3f5f', 'If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.', NULL, NULL, 'LINE', NULL, 10, '', '88498cc2eeef4905ce9452eb8241da52', NULL, ''),
(8349, 'en', 'default', '85540ae266a03383e65007e160616c39', 'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.', NULL, NULL, 'LINE', NULL, 10, '', '82da5429bc5561bbe23b1b043e08de1a', NULL, ''),
(8350, 'en', 'default', '3f2b4cfd2cad80bf7584970a3f835c02', 'If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.', NULL, NULL, 'LINE', NULL, 10, '', '1aefc2014eb00ab096a7cc8ca09b5ee2', NULL, ''),
(8351, 'en', 'default', 'b7356884085f8ba4da0d0975927c6332', 'Embedded content from other websites', NULL, NULL, 'LINE', NULL, 10, '', '7107a4cd49e362905e46b41473054a9f', NULL, ''),
(8352, 'en', 'default', '21619874853161da6da2aaf4f1352b7c', 'Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.', NULL, NULL, 'LINE', NULL, 10, '', '8a513931173c1a7136db5080a445e533', NULL, ''),
(8353, 'en', 'default', '962c28891ea0971c27aec3bfc1781b57', 'These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.', NULL, NULL, 'LINE', NULL, 10, '', '07835bfb9b2600b722360fd372e71ff1', NULL, ''),
(8354, 'en', 'default', 'a768caa988605a2846599cf7e2d0c26a', 'Analytics', NULL, NULL, 'LINE', NULL, 10, '', '70efa456583f37f77003d9f7871ac35d', NULL, ''),
(8355, 'en', 'default', '48ac74d87e61fcb5c2adf64ca48cf64e', 'In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.', NULL, NULL, 'LINE', NULL, 10, '', 'ef6c1a3649fca4635c6d724a7e8e9440', NULL, ''),
(8356, 'en', 'default', 'a9aaa5a8c454b3604df40c08faf864cb', 'By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.', NULL, NULL, 'LINE', NULL, 10, '', 'bbb10dc461ad05c0ba1743dbb84c6a33', NULL, ''),
(8357, 'en', 'default', 'b36d0f4f434f0ca2b84a3507673dbf63', 'Who we share your data with', NULL, NULL, 'LINE', NULL, 10, '', 'cf98bfb7cb46423fcee1242d5f7f16d4', NULL, ''),
(8358, 'en', 'default', '88afac7dd32e40bf990b8d3423dfcb5e', 'In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.', NULL, NULL, 'LINE', NULL, 10, '', 'bc39528f72dd657a817abfe0e70fa67f', NULL, ''),
(8359, 'en', 'default', '72927f6ce8ef34a17482510ae8e43c73', 'By default WordPress does not share any personal data with anyone.', NULL, NULL, 'LINE', NULL, 10, '', '3e2c17f51ad2871c50487c676743a6bb', NULL, ''),
(8360, 'en', 'default', '719a276cdff21fb86344c5e71684c4bc', 'How long we retain your data', NULL, NULL, 'LINE', NULL, 10, '', '84aa09d46aa51e6e1bf91dec8d05e034', NULL, ''),
(8361, 'en', 'default', 'bb1232b0272e71fd61576bb759fe4fcb', 'In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.', NULL, NULL, 'LINE', NULL, 10, '', 'ab44f2d90a4122efb4d73b1271ddcd1e', NULL, ''),
(8362, 'en', 'default', 'b821f0a93d744e025849cd46e8b3baad', 'If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.', NULL, NULL, 'LINE', NULL, 10, '', '2adafd60d076932c43e67845ed14dde0', NULL, ''),
(8363, 'en', 'default', '522aadf23f305abae106a83bf430576e', 'For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.', NULL, NULL, 'LINE', NULL, 10, '', 'e72f6eaabce2f1292d15c25394db0b83', NULL, ''),
(8364, 'en', 'default', 'b77abd58d17fa7323ad0f0e230265377', 'What rights you have over your data', NULL, NULL, 'LINE', NULL, 10, '', 'eaaf98b0e5cc32f07bb473bb28a8162d', NULL, ''),
(8365, 'en', 'default', '7b43f0a3a9bad71b5515c3febf1c4e85', 'In this section you should explain what rights your users have over their data and how they can invoke those rights.', NULL, NULL, 'LINE', NULL, 10, '', '1d494e615fc6d7af13588575aa5f764a', NULL, ''),
(8366, 'en', 'default', 'ae1bc04b5e3967feb6adc498b8d57f62', 'If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.', NULL, NULL, 'LINE', NULL, 10, '', 'c0b485544617c4aba2e6cc625c5732d8', NULL, ''),
(8367, 'en', 'default', '79cc13f4de633a7fd0a8dc7c5c03de3d', 'Where we send your data', NULL, NULL, 'LINE', NULL, 10, '', 'dc9cfd4a3cd299346ceccf5ec2767598', NULL, ''),
(8368, 'en', 'default', 'e033cd0f72a714684763bb3b10497ef1', 'In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.', NULL, NULL, 'LINE', NULL, 10, '', '6bab02ff41df219f416fc29c55fd9271', NULL, '');
INSERT INTO `arch_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES
(8369, 'en', 'default', 'd3d0a99752e8793c0f2891b4a0dccd7d', 'European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.', NULL, NULL, 'LINE', NULL, 10, '', '6d750ee1a6f3c7ea9e7b07ab963c68f0', NULL, ''),
(8370, 'en', 'default', '902789e4687e71730f1df3f80c6ddd6c', 'Visitor comments may be checked through an automated spam detection service.', NULL, NULL, 'LINE', NULL, 10, '', '64c67802c34cf8a8f08b4aea127700fb', NULL, ''),
(8371, 'en', 'default', '06dbd0c1d81b8281a3bc9c21d59725c7', 'Your contact information', NULL, NULL, 'LINE', NULL, 10, '', '61f93c346edab7f02fa9c3dd24b19a36', NULL, ''),
(8372, 'en', 'default', '562b66a0805d1853fa06902cdb6774d5', 'In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.', NULL, NULL, 'LINE', NULL, 10, '', 'b783b38f8b0382d31f2e0d6b68dc26ff', NULL, ''),
(8373, 'en', 'default', '0f68b904e33d9ac04605aecc958bcf52', 'Additional information', NULL, NULL, 'LINE', NULL, 10, '', 'deba883b423f91e94597e7842820df4b', NULL, ''),
(8374, 'en', 'default', '28479dd04f0c4f904cbfc647df8a39f7', 'If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.', NULL, NULL, 'LINE', NULL, 10, '', '26059df016ea17b5bee3abc3165cc69d', NULL, ''),
(8375, 'en', 'default', 'eedb81c7ccdd675c82430eb4d06bcec2', 'How we protect your data', NULL, NULL, 'LINE', NULL, 10, '', 'e8cfa9664384947b51997f82809ceab5', NULL, ''),
(8376, 'en', 'default', '9f2feaf2b829a5c3749cb3a0dec950a7', 'In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.', NULL, NULL, 'LINE', NULL, 10, '', '447f7c9e79da2eaf80b14485c81eef4a', NULL, ''),
(8377, 'en', 'default', 'b913161fbf9e35c3c4cac8c6260eb2d6', 'What data breach procedures we have in place', NULL, NULL, 'LINE', NULL, 10, '', 'a15090ee82dea20072fad68f6639eaed', NULL, ''),
(8378, 'en', 'default', 'cc868b88b34779f820016d60eeb4d13f', 'In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.', NULL, NULL, 'LINE', NULL, 10, '', '2e2f9f76d2e53db3e5050f6eed876131', NULL, ''),
(8379, 'en', 'default', '41733fc9673b9e3189ef34fad3240ffd', 'What third parties we receive data from', NULL, NULL, 'LINE', NULL, 10, '', 'b549e8965e06eb74df89650d84634eeb', NULL, ''),
(8380, 'en', 'default', 'b127c8939223b7c79e41917477d2e09e', 'If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.', NULL, NULL, 'LINE', NULL, 10, '', 'bdb7658161c5f57d631ee4aa4a631ecf', NULL, ''),
(8381, 'en', 'default', 'a0b4dc8a5171d89c25ef2542dbcb8851', 'What automated decision making and/or profiling we do with user data', NULL, NULL, 'LINE', NULL, 10, '', '749c2bb3773d6ce13ee781eecd8943f4', NULL, ''),
(8382, 'en', 'default', '3ac9c7fe01cf02c25932c2fce99d968a', 'If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.', NULL, NULL, 'LINE', NULL, 10, '', 'c7ffd4403fc114954b738bbcbe9fea06', NULL, ''),
(8383, 'en', 'default', '33dec286c87af12437699c4c1feeec9f', 'Industry regulatory disclosure requirements', NULL, NULL, 'LINE', NULL, 10, '', '701077419f0b3ee3eff24186dc2be58d', NULL, ''),
(8384, 'en', 'default', '03191ad53bd55facfbe806e381b5aff0', 'If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.', NULL, NULL, 'LINE', NULL, 10, '', 'd393238caa2225600eef5118eaa27ec1', NULL, ''),
(8385, 'en', 'default', '8f7f4c1ce7a4f933663d10543562b096', 'About', NULL, NULL, 'LINE', NULL, 10, 'page title', '1c6eeb883ef174f9ce52e42b3a7e596f', NULL, ''),
(8386, 'en', 'default', 'a5f36e4031b4162f7dadf8542c86e967', 'Return to Dashboard &rarr; Updates', NULL, NULL, 'LINE', NULL, 0, '', '2a2b6bab5a2e3b1d61184bcc6e6e8e68', NULL, ''),
(8387, 'en', 'default', 'd11b7ef1ad870a0baddc8cc8c1ee5617', 'A request for this email address already exists.', NULL, NULL, 'LINE', NULL, 10, '', '31b895a771a71b345049ca5ce7f83156', NULL, ''),
(8388, 'en', 'default', '8b98aee689ad1582825109286f84f678', 'Action has been confirmed.', NULL, NULL, 'LINE', NULL, 10, '', '5ff4fef9820b15a87bb08fcd6cef55a4', NULL, ''),
(8389, 'en', 'default', 'a4566410fa653c90f296f4d268be1266', 'Comment %d contains personal data but could not be anonymized.', NULL, NULL, 'LINE', NULL, 10, '', '652d07d4567ebe4cd32bee9a4323ffb4', NULL, ''),
(8390, 'en', 'default', '2f28746b0d77875909b13f59a0e1fbc6', 'Comment Author', NULL, NULL, 'LINE', NULL, 10, '', '0af87b321bb8f44cc4247703b56e90b4', NULL, ''),
(8391, 'en', 'default', 'c70542f8f828c4ce68bab56163f8eb1a', 'Comment Author Email', NULL, NULL, 'LINE', NULL, 10, '', '42e8b938bad3f13d920f189df2103390', NULL, ''),
(8392, 'en', 'default', 'df5313017659ce22f7e2ee551c96d2a9', 'Comment Author IP', NULL, NULL, 'LINE', NULL, 10, '', '44bdb1efc1a5022ba4b73e058b777b0a', NULL, ''),
(8393, 'en', 'default', '3e2cba7ab3c13216ac8b8b8da3e21b1c', 'Comment Author URL', NULL, NULL, 'LINE', NULL, 10, '', 'b727535272a398cd20dd89483c49b358', NULL, ''),
(8394, 'en', 'default', 'fcbcad4c93c6605e921355f33c6b34da', 'Comment Author User Agent', NULL, NULL, 'LINE', NULL, 10, '', 'f1b6187749db5f2f42fb03371e9e1730', NULL, ''),
(8395, 'en', 'default', 'afa81df6c8528d52f7782df5571d0277', 'Comment Content', NULL, NULL, 'LINE', NULL, 10, '', '424385920ccd01d0d24758c107dbe8ff', NULL, ''),
(8396, 'en', 'default', 'ddbcb78304180b2273f153bfaa689d03', 'Comment Date', NULL, NULL, 'LINE', NULL, 10, '', '56a68432c3686b745800974b20ae6e98', NULL, ''),
(8397, 'en', 'default', '477b5398c5667610b96d6a00ca5e2ec9', 'Comment URL', NULL, NULL, 'LINE', NULL, 10, '', 'e3f9355dd3e7758a7892c598f277f7a4', NULL, ''),
(8398, 'en', 'default', '07ca5050e697392c9ed47e6453f1453f', 'Completed', NULL, NULL, 'LINE', NULL, 10, '', 'a103599bf5af329406cf123cf5d18367', NULL, ''),
(8399, 'en', 'default', '4b121bda94d2c436c478acdc93ae67ae', 'Confirm the \"%s\" action', NULL, NULL, 'LINE', NULL, 10, '', 'ab0145d1b74920fd21e74192e85d5b73', NULL, ''),
(8400, 'en', 'default', '205bc73c4ab4286a1fb9d4c18322777c', 'Confirmed', NULL, NULL, 'LINE', NULL, 10, '', '26fb91a29262ed608ed9b6b3e660b928', NULL, ''),
(8401, 'en', 'default', 'd7c8c85bf79bbe1b7188497c32c3b0ca', 'Failed', NULL, NULL, 'LINE', NULL, 10, '', 'b92b482664887f020dd9560c01c020be', NULL, ''),
(8402, 'en', 'default', 'f4632513a751e8266f66005e078ec1d2', 'Howdy,\\n\\nA request has been made to perform the following action on your account:\\n\\n     ###DESCRIPTION###\\n\\nTo confirm this, please click on the following link:\\n###CONFIRM_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###.\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, 'LINE', NULL, 10, '', '9fb2ff8e7303c25b22d514a10ad034c2', NULL, ''),
(8403, 'en', 'default', 'a3448d08f0fb51527fe3a8b4313869c8', 'Howdy,\\n\\nA user data privacy request has been confirmed on ###SITENAME###:\\n\\nUser: ###USER_EMAIL###\\nRequest: ###DESCRIPTION###\\n\\nYou can view and manage these data privacy requests here:\\n\\n###MANAGE_URL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, 'LINE', NULL, 10, '', 'c8c30e6dc1f7b6e1e74b1046aa55e8a5', NULL, ''),
(8404, 'en', 'default', '45c6e468c22eeb80c1c730531caf17b1', 'Howdy,\\n\\nYour request to erase your personal data on ###SITENAME### has been completed.\\n\\nIf you have any follow-up questions or concerns, please contact the site administrator.\\n\\nFor more information, you can also read our privacy policy: ###PRIVACY_POLICY_URL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, 'LINE', NULL, 10, '', 'fc6d4b623463133874c256fe0e6aa334', NULL, ''),
(8405, 'en', 'default', '722a8730a2dd8838086a140dea4debb1', 'Howdy,\\n\\nYour request to erase your personal data on ###SITENAME### has been completed.\\n\\nIf you have any follow-up questions or concerns, please contact the site administrator.\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, 'LINE', NULL, 10, '', 'bdc7d526198cec19fcc92df21a75c945', NULL, ''),
(8406, 'en', 'default', 'dbf373dd3565accf2d2fd19700f6a5ae', 'Invalid action', NULL, NULL, 'LINE', NULL, 10, '', 'b2d369141759b7f8e2a5419f1407a505', NULL, ''),
(8407, 'en', 'default', '0c4de6f54e6b4984f613f8346a104dc1', 'Invalid action name.', NULL, NULL, 'LINE', NULL, 10, '', '4459d0ff438f78c45f9696f9e053ff54', NULL, ''),
(8408, 'en', 'default', '777f9e90cf251ec077f633406368c632', 'Invalid request.', NULL, NULL, 'LINE', NULL, 10, '', '2825482bcb57a217fa5e754fd4653acf', NULL, ''),
(8409, 'en', 'default', '75aa1e9cd11775373802fbece31d674b', 'Limit result set to users who are considered authors.', NULL, NULL, 'LINE', NULL, 10, '', '25ac9fe94d3a87764c3c2b0e85e210ce', NULL, ''),
(8410, 'en', 'default', '2d13df6f8b5e4c5af9f87e0dc39df69d', 'Pending', NULL, NULL, 'LINE', NULL, 10, '', '4eee4aea4ab2873cc36cd3f5889e7c8b', NULL, ''),
(8411, 'en', 'default', 'fa2ead697d9998cbc65c81384e6533d5', 'Privacy Policy', NULL, NULL, 'LINE', NULL, 10, '', '66ce7f2508f978ebbaa2ab89ffedf45a', NULL, ''),
(8412, 'en', 'default', '3b285e2995b45a8a78d1b57bdb6caff4', 'Save my name, email, and website in this browser for the next time I comment.', NULL, NULL, 'LINE', NULL, 10, '', '9af4dbd3fdba144f742dc2bbe94d26b8', NULL, ''),
(8413, 'en', 'default', '0091a15cf9cd91d970637e36853dc651', 'Sorry, you are not allowed to query users by this parameter.', NULL, NULL, 'LINE', NULL, 10, '', 'e84388e442148e4a36153c047566fc83', NULL, ''),
(8414, 'en', 'default', '0ce441d34c6bc5defa0d900f847c6836', 'Thanks for confirming your erasure request.', NULL, NULL, 'LINE', NULL, 10, '', '500ff780dd10a067fcd8e6c1f33140fd', NULL, ''),
(8415, 'en', 'default', 'c5e572673aa3efedaa4ea82e7d41716a', 'Thanks for confirming your export request.', NULL, NULL, 'LINE', NULL, 10, '', 'c3bf3ac01fd01bf7ed1eaebd754623b4', NULL, ''),
(8416, 'en', 'default', '8a271d734486ae971a828cda4cbe9796', 'The confirmation email has expired.', NULL, NULL, 'LINE', NULL, 10, '', '7ca1471aa255c07911eefea53b472488', NULL, ''),
(8417, 'en', 'default', 'aa5865eb376271d1d46aaed6dfe6f535', 'The site administrator has been notified and will fulfill your request as soon as possible.', NULL, NULL, 'LINE', NULL, 10, '', '31517062974599005dc2f4855e55157d', NULL, ''),
(8418, 'en', 'default', '7aae15800f70633f2d92c912b00a79c6', 'The site administrator has been notified. You will receive a link to download your export via email when they fulfill your request.', NULL, NULL, 'LINE', NULL, 10, '', '7bd0dc755bedefd9197a1d6ad9676085', NULL, ''),
(8419, 'en', 'default', '4c19b4869f216a582a87f5181998bdb9', 'The site administrator has been notified. You will receive an email confirmation when they erase your data.', NULL, NULL, 'LINE', NULL, 10, '', 'b9864ed7e5495d3d178246b0f8a211da', NULL, ''),
(8420, 'en', 'default', 'd2c3c7805321d01e9bb8d5fa675eb06c', 'This content was deleted by the author.', NULL, NULL, 'LINE', NULL, 10, '', '99f8f8cb1610e3883775e5680512bd7d', NULL, ''),
(8421, 'en', 'default', 'e2b6bcb991140139f1b2b4a209ac12e0', 'This link has expired.', NULL, NULL, 'LINE', NULL, 10, '', 'db2d660ec2ebdf26f35855babbad9aa3', NULL, ''),
(8422, 'en', 'default', '8f9bfe9d1345237cb3b2b205864da075', 'User', NULL, NULL, 'LINE', NULL, 10, '', 'f1409c7b9ffbf730af47b2fb984a01c5', NULL, ''),
(8423, 'en', 'default', '9012a64fd878bb959c31d959ed5f26e5', 'User Description', NULL, NULL, 'LINE', NULL, 10, '', 'bf5db03d882ff5a84a05796bab5ac69d', NULL, ''),
