(8566, 'en', 'default', 'f9251b5ea74dd4ca2c3ead011a5555db', 'We have suggested the sections you will need. Under each section heading you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.', NULL, NULL, 'LINE', NULL, 10, '', '7eb3381a57ff400f1d1db4eba559794c', NULL, ''),
(8567, 'en', 'default', '529fcd56c4d659df86b9c82023912e91', 'We would also suggest reviewing your privacy policy from time to time, especially after installing or updating any themes or plugins. There may be changes or new suggested information for you to consider adding to your policy.', NULL, NULL, 'LINE', NULL, 10, '', '60bdb0d39715045e35550c0d7eec9c8a', NULL, ''),
