(8583, 'en', 'contact-form-7', 'f6244c90bcc51de9d6df853307d92ad8', '<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.', NULL, NULL, 'LINE', NULL, 10, '', '1ca4da0cce10b996f7ded1ef9fb4f3ec', NULL, ''),
(8584, 'en', 'contact-form-7', '90e98b3c13f62af6edadcf1cb8a1f8ac', '<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.', NULL, NULL, 'LINE', NULL, 10, '', 'e2e610466e43a4c2aafbb91a66c2d2b1', NULL, ''),
(8585, 'en', 'contact-form-7', '5542e599411994aa1e521658227dab43', '<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href=\"%3$s\">update WordPress</a> first.', NULL, NULL, 'LINE', NULL, 10, '', '04247bfeace9a63e6eec2c571115286f', NULL, ''),
(8586, 'en', 'contact-form-7', 'a6fdca11cd20cd9feabece957bfcadbb', '<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.', NULL, NULL, 'LINE', NULL, 10, '', 'b6e099df716ba84aada7287dc8cc23f6', NULL, ''),
(8587, 'en', 'contact-form-7', '4ef427b4f52b8def1ff6563e403ad0aa', '<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.', NULL, NULL, 'LINE', NULL, 10, '', 'ea76c2469f54366347c0d04fef3cec30', NULL, ''),
(8588, 'en', 'contact-form-7', 'a25ed68c9a8e9cf1208dc06da5ca9e6d', '<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.', NULL, NULL, 'LINE', NULL, 10, '', '5880875d721835f16410b86d5cd8c14b', NULL, ''),
(8589, 'en', 'contact-form-7', 'ee9be757d9d1fc5edf191c10af054b55', '<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.', NULL, NULL, 'LINE', NULL, 10, '', '322cb620832476ea07856f78699980a3', NULL, ''),
(8590, 'en', 'contact-form-7', '4573c02dd1f6585f8da85e5d065de084', '<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.', NULL, NULL, 'LINE', NULL, 10, '', '74eac5df9f32c130fc7f777145142e33', NULL, ''),
(8591, 'en', 'contact-form-7', '8d44de43f8128813c4341ae759f1bc2b', '<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.', NULL, NULL, 'LINE', NULL, 10, '', 'c5ed9c58ac7509b05ae78d439c77a948', NULL, ''),
(8592, 'en', 'contact-form-7', 'cf1e52339d6aabd416f1b9706826c14a', 'A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.', NULL, NULL, 'LINE', NULL, 10, '', 'b1969d732ba400a04aa90bfb6c1e962b', NULL, ''),
(8593, 'en', 'contact-form-7', 'f203d7bf1700903f826c0648ca8c84ac', 'A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.', NULL, NULL, 'LINE', NULL, 10, '', '64b230e8e0b79669dc0a20ced17e0ce7', NULL, ''),
(8594, 'en', 'contact-form-7', '53d75036aa42ff7a7743ab4c4e9324b2', 'Acceptable file types', NULL, NULL, 'LINE', NULL, 10, '', 'e0a2213478396c8d8a473b6b831cbe28', NULL, ''),
(8595, 'en', 'contact-form-7', 'cb1175dd5d77693f455508a5a2228e45', 'Acceptance Checkbox', NULL, NULL, 'LINE', NULL, 10, '', '5399edd006b642c041f9fbcda59b6e0f', NULL, ''),
(8596, 'en', 'contact-form-7', '8f4f66b5d8cdc2202294e1cbd2e09780', 'Additional Headers', NULL, NULL, 'LINE', NULL, 10, '', '38925b06453c7c5e4d5679ac238d5341', NULL, ''),
