(8884, 'en', 'contact-form-7', '634711044793d2163bb96136d63b5fe2', 'Install a message storage plugin before this happens to you. %s saves all messages through contact forms into the database. Flamingo is a free WordPress plugin created by the same author as Contact Form 7.', NULL, NULL, 'LINE', NULL, 0, '', '886327860e62fd202d832b9d620f109a', NULL, ''),
