(8939, 'en', 'regenerate-thumbnails', '2e0ec374ec12f34a77296f1cc1fbc264', 'When you change WordPress themes or change the sizes of your thumbnails at <a href=\"%s\">Settings ‚Üí Media</a>, images that you have previously uploaded to you media library will be missing thumbnail files for those new image sizes. This tool will allow you to create those missing thumbnail files for all images.', NULL, NULL, 'LINE', NULL, 0, '', '5fbfbf1c476b2ece08e00f41d6291bb6', NULL, ''),
