(8949, 'en', 'regenerate-thumbnails', 'da566411423c9ef4fdda5ca89db0c7a5', 'If you have <a href=\"{url-cli}\">command-line</a> access to your site\'s server, consider using <a href=\"{url-wpcli}\">WP-CLI</a> instead of this tool. It has a built-in <a href=\"{url-wpcli-regenerate}\">regenerate command</a> that works similarly to this tool but should be significantly faster since it has the advantage of being a command-line tool.', NULL, NULL, 'LINE', NULL, 0, '', 'aca138786b08cfcdec754da29e2bf72f', NULL, ''),
(8950, 'en', 'regenerate-thumbnails', 'a4c9fc3819d970151ea0083a46ec75eb', 'Another alternative is to use the <a href=\"{url-photon}\">Photon</a> functionality that comes with the <a href=\"{url-jetpack}\">Jetpack</a> plugin. It generates thumbnails on-demand using WordPress.com\'s infrastructure. <em>Disclaimer: The author of this plugin, Regenerate Thumbnails, is an employee of the company behind WordPress.com and Jetpack but I would recommend it even if I wasn\'t.', NULL, NULL, 'LINE', NULL, 0, '', '254129c51ca8ab170c9c8985c38592a9', NULL, ''),
