(9738, 'en', 'default', 'a1abc8d25137999cd95f32ea95aaebb4', 'After your Privacy Policy page is set, we suggest that you edit it.', NULL, NULL, 'LINE', NULL, 10, '', '17acf00fe80c7cdf90975a61e9a993fe', NULL, ''),
(9739, 'en', 'default', '54fa978c5162ddc82d7cec4d7ed1a643', 'As a new WordPress user, you should go to <a href=\"%s\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', NULL, NULL, 'LINE', NULL, 10, '', '7da6a0da35bddb70002bd6a2263d19b3', NULL, ''),
(9740, 'en', 'default', '14697ae200ff0d684feafc2a4e50332d', 'As a website owner, you may need to follow national or international privacy laws. For example, you may need to create and display a Privacy Policy.', NULL, NULL, 'LINE', NULL, 10, '', 'f505d554a944a35993daa304142e88c9', NULL, ''),
(9741, 'en', 'default', '0ae8f819b5d10eca39a4c7de0167e542', 'Blocks provide a comfortable way for users to change content directly, while also ensuring the content structure cannot be easily disturbed by accidental code edits. This allows the developer to control the output, building polished and semantic markup that is preserved through edits and not easily broken.', NULL, NULL, 'LINE', NULL, 10, '', 'c7e58cea7aec71a4fd962e310be6c53f', NULL, ''),
(9742, 'en', 'default', 'b8c3fbc80a978833c8b837cd00cbb319', 'Build your first post', NULL, NULL, 'LINE', NULL, 10, '', '13292e66e699b82edd44a201f81367f7', NULL, ''),
