(9753, 'en', 'default', '423420513f9c5722dff414ddad5692d5', 'Featuring ample whitespace, and modern sans-serif headlines paired with classic serif body text, Twenty Nineteen is built to be beautiful on the go. It uses system fonts to increase loading speed. No more long waits on slow networks!', NULL, NULL, 'LINE', NULL, 10, '', '772d3b0f8e56331add6f42d97d22b971', NULL, ''),
(9754, 'en', 'default', '306fa861b92d66278759212d8a9d22a2', 'Freedom to Build, Freedom to Write', NULL, NULL, 'LINE', NULL, 10, '', 'c3bb5e0544a6fb50dc6b43a0be89c2ca', NULL, ''),
(9755, 'en', 'default', '7dd9160069d47d486b311bfdc022e943', 'Give Twenty Nineteen a try', NULL, NULL, 'LINE', NULL, 10, '', 'f9d750cef49880513d73776347c8c1de', NULL, ''),
(9756, 'en', 'default', '0fe26287994e5dae9bd091faac4fae53', 'Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)', NULL, NULL, 'LINE', NULL, 10, '', '8b149ecb0093cc6559bb2f7dfd7d54dc', NULL, ''),
(9757, 'en', 'default', 'aa5da9e4a780bbdb0c340ce833c86d7b', 'Howdy,\\n\\nYour request for an export of personal data has been completed. You may\\ndownload your personal data by clicking on the link below. For privacy\\nand security, we will automatically delete the file on ###EXPIRATION###,\\nso please download it before then.\\n\\n###LINK###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, 'LINE', NULL, 10, '', '1c2aa9f43567a968900f1c907fb5ccfb', NULL, ''),
(9758, 'en', 'default', '60d97f3583f770229990ed5aeffaeb96', 'However, it is your responsibility to use those resources correctly, to provide the information that your Privacy Policy requires, and to keep that information current and accurate.', NULL, NULL, 'LINE', NULL, 10, '', '9f68c1ce495b76c67c63a4680e89b0de', NULL, ''),
(9759, 'en', 'default', '9c5a9c6b4c6ae1c5fb60ea2ade59d87d', 'If you already have a Privacy Policy page, please select it below. If not, please create one.', NULL, NULL, 'LINE', NULL, 10, '', '90c122e5176b8e48d55736c13f77a036', NULL, ''),
(9760, 'en', 'default', '5fd414d3b7a12bb6300808bf0733f89a', 'Introducing Twenty Nineteen, a new default theme that shows off the power of the new editor.', NULL, NULL, 'LINE', NULL, 10, '', '16d290c139707d1538b65f7744aee464', NULL, ''),
