(9783, 'en', 'default', '39a587f6dbd95cb6562da9037088472f', 'The Classic Editor plugin restores the previous WordPress editor and the Edit Post screen. It lets you keep using plugins that extend it, add old-style meta boxes, or otherwise depend on the previous editor. To install, visit your plugins page and click the &#8220;Install Now&#8221; button next to &#8220;Classic Editor&#8221;. After the plugin finishes installing, click &#8220;Activate&#8221;. That‚Äôs it!', NULL, NULL, 'LINE', NULL, 10, '', 'a158d7ea2da99636bb0cfbb4ff3a6fbc', NULL, ''),
(9784, 'en', 'default', '48ece19e2b97c80cc6110ce99aeaa02b', 'The Gutenberg plugin has been deactivated, as the features are now included in WordPress %1$s by default. If you&#8217;d like to continue to test the upcoming changes in the WordPress editing experience, please %2$sreactivate the Gutenberg plugin%3$s.', NULL, NULL, 'LINE', NULL, 10, '', '8c7921473d4307777d6b681a8ef34ea8', NULL, ''),
(9785, 'en', 'default', '7c3fa617cc659374bf5335f14e85e1f0', 'The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.', NULL, NULL, 'LINE', NULL, 10, '', '7be05e2c149e3eb3da9856ca422c1635', NULL, ''),
