(9787, 'en', 'default', '7e1c956a01ff33aeda36b145b46cfa5c', 'The currently selected Privacy Policy page does not exist. Please create or select a new page.', NULL, NULL, 'LINE', NULL, 10, '', 'e7bf979a9539b00d2878d613071434e7', NULL, ''),
