(9789, 'en', 'default', '66410f920e4e74b45011539119b006d9', 'The front-end of Twenty Nineteen on the left, and how it looks in the editor on the right.', NULL, NULL, 'LINE', NULL, 10, '', '398712a119114540fa1214f4b373a525', NULL, ''),
(9790, 'en', 'default', '4695a60f0df306c9789f1c07fe0375da', 'The new block paradigm opens up a path of exploration and imagination when it comes to solving user needs. With the unified block insertion flow, it&#8217;s easier for your clients and customers to find and use blocks for all types of content. Developers can focus on executing their vision and providing rich editing experiences, rather than fussing with difficult APIs.', NULL, NULL, 'LINE', NULL, 10, '', '58678623f70893c9da25db132351729f', NULL, ''),
(9791, 'en', 'default', '72767e68111ba9fb4df1168920eff12d', 'The new block-based editor won&#8217;t change the way any of your content looks to your visitors. What it will do is let you insert any type of multimedia in a snap and rearrange to your heart&#8217;s content. Each piece of content will be in its own block; a distinct wrapper for easy maneuvering. If you&#8217;re more of an HTML and CSS sort of person, then the blocks won&#8217;t stand in your way. WordPress is here to simplify the process, not the outcome.', NULL, NULL, 'LINE', NULL, 10, '', '877acacd060197a0b2c3e994bebc9495', NULL, ''),
(9792, 'en', 'default', 'dd3155e4a5a8436bff4472ce0244fb17', 'The new page will include help and suggestions for your Privacy Policy.', NULL, NULL, 'LINE', NULL, 10, '', 'fb1bcb3caa567be21344c40f887df70f', NULL, ''),
