(9794, 'en', 'default', 'bf23c9d2e15af60f61123487ff157cca', 'The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.', NULL, NULL, 'LINE', NULL, 10, '', 'bcc69e8ebdfd1dd205bb31737b829195', NULL, ''),
(9795, 'en', 'default', 'debe674039533cd446d052a6f9d5acdd', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:', NULL, NULL, 'LINE', NULL, 10, '', 'a5d9669f328f87e2b022b68196e4b9c6', NULL, ''),
