(9804, 'en', 'default', '0926abc7bf3b25663fddeb996c3c042a', 'Twenty Nineteen features custom styles for the blocks available by default in 5.0. It makes extensive use of editor styles throughout the theme. That way, what you create in your content editor is what you see on the front of your site.', NULL, NULL, 'LINE', NULL, 10, '', '4f329a792475a156ef6aec3c6b0e6399', NULL, ''),
