lizacji. Wykryto podatno≈õƒá na atak XSS w plikach Flash biblioteki MediaElement, kt√≥ra jest do≈ÇƒÖczana do WordPressa w celu zapewnienia kompatybilno≈õci ze starszym oprogramowaniem. Poniewa≈º pliki te nie sƒÖ ju≈º potrzebne w zdecydowanej wiƒôkszo≈õci przypadk√≥w, zosta≈Çy one usuniƒôte [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Chris Trynkiewicz (Sukces Strony)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4168:\"<p>WordPress 4.9.2 jest ju≈º dostƒôpny. <strong>To wydanie poprawia bezpiecze≈Ñstwo</strong> we wszystkich poprzednich wersjach systemu. Zalecane jest natychmiastowe przeprowadzenie aktualizacji.</p>\n<p><span id=\"more-1512\"></span></p>\n<p>Wykryto podatno≈õƒá na atak XSS w plikach Flash biblioteki MediaElement, kt√≥ra jest do≈ÇƒÖczana do WordPressa w celu zapewnienia kompatybilno≈õci ze starszym oprogramowaniem. Poniewa≈º pliki te nie sƒÖ ju≈º potrzebne w zdecydowanej wiƒôkszo≈õci przypadk√≥w, zosta≈Çy one usuniƒôte z WordPressa.</p>\n<p>Biblioteka MediaElement zosta≈Ça ju≈º udostƒôpniona w nowej wersji, kt√≥ra naprawa problem. W repozytorium wtyczek WordPressa znajduje siƒô nowa <a href=\"https://wordpress.org/plugins/mediaelement-flash-fallbacks/\">wtyczka, przywracajƒÖca obs≈Çugƒô biblioteki MediaElement z poprawionymi plikami</a>.</p>\n<p>Dziƒôkujemy zg≈ÇaszajƒÖcym (<a href=\"https://opnsec.com\">Enguerran Gillier</a>¬†i¬†<a href=\"https://widiz.com/\">Widiz</a>) za <a href=\"https://make.wordpress.org/core/handbook/reporting-security-vulnerabilities/\">odpowiedzialne ujawnienie</a> problem√≥w z bezpiecze≈Ñstwem.</p>\n<p>W WordPressie 4.9.2 rozwiƒÖzano tak≈ºe 21 innych problem√≥w, w tym:</p>\n<ul>\n<li>naprawiono b≈Çƒôdy JavaScript, kt√≥re uniemo≈ºliwia≈Çy zapisywanie wpis√≥w w Firefoxie,</li>\n<li>przywr√≥cono wcze≈õniejsze, niezale≈ºne od taksonomii dzia≈Çanie <code>get_category_link()</code>¬†i¬†<code>category_description()</code>,</li>\n<li>od teraz zmiana motywu spowoduje podjƒôcie pr√≥by przywr√≥cenia poprzednich przypisa≈Ñ widget√≥w &#8211; nawet, je≈õli w ostatnio u≈ºywanym motywie nie by≈Çy dostƒôpne ≈ºadne obszary na widgety.</li>\n</ul>\n<p>W dokumentacji Codex znajdziesz <a href=\"https://codex.wordpress.org/Version_4.9.2\">wiƒôcej informacji na temat wszystkich rozwiƒÖzanych problem√≥w w wersji 4.9.2</a>.</p>\n<p><a href=\"https://pl.wordpress.org/\">Pobierz WordPressa 4.9.2</a>¬†lub udaj siƒô do sekcji Kokpit ‚Üí Aktualizacje panelu administracyjnego i po prostu kliknij przycisk ‚ÄûZaktualizuj teraz‚Äù. Witryny, kt√≥re obs≈ÇugujƒÖ automatyczne aktualizacje, rozpoczƒô≈Çy ju≈º ich przeprowadzanie.</p>\n<p>Dziƒôkujemy wszystkim, kt√≥rzy przyczynili siƒô do powstania wersji 4.9.2:</p>\n<p><a href=\"https://profiles.wordpress.org/0x6f0/\">0x6f0</a>, <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/afercia/\">Andrea Fercia</a>, <a href=\"https://profiles.wordpress.org/aduth/\">Andrew Duthie</a>, <a href=\"https://profiles.wordpress.org/azaozz/\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/blobfolio/\">Blobfolio</a>, <a href=\"https://profiles.wordpress.org/boonebgorges/\">Boone Gorges</a>, <a href=\"https://profiles.wordpress.org/icaleb/\">Caleb Burks</a>, <a href=\"https://profiles.wordpress.org/poena/\">Carolina Nymark</a>, <a href=\"https://profiles.wordpress.org/chasewg/\">chasewg</a>, <a href=\"https://profiles.wordpress.org/chetan200891/\">Chetan Prajapati</a>, <a href=\"https://profiles.wordpress.org/dd32/\">Dion Hulse</a>, <a href=\"https://profiles.wordpress.org/hardik-amipara/\">Hardik Amipara</a>, <a href=\"https://profiles.wordpress.org/ionvv/\">ionvv</a>, <a href=\"https://profiles.