=\"a\">\r\n            <li><a href=\"https://support.microsoft.com/pl-pl/kb/196955\" target=\"_blank\" rel=\"nofollow\">Internet Explorer</a>\r\n            </li>\r\n            <li><a href=\"https://support.google.com/chrome/answer/95647?hl=pl\" target=\"_blank\" rel=\"nofollow\">Chrome</a>\r\n            </li>\r\n            <li><a href=\"https://support.apple.com/kb/PH5042?locale=pl_PL\" target=\"_blank\" rel=\"nofollow\">Safari</a>\r\n            </li>\r\n            <li><a href=\"https://support.mozilla.org/pl/kb/W%C5%82%C4%85czanie%20i%20wy%C5%82%C4%85czanie%20obs%C5%82ugi%20ciasteczek\" target=\"_blank\" rel=\"nofollow\">Firefox</a>\r\n            </li>\r\n            <li><a href=\"http://help.opera.com/Windows/12.10/pl/cookies.html\" target=\"_blank\" rel=\"nofollow\">Opera</a>\r\n            </li>\r\n            <li><a href=\"https://support.google.com/chrome/answer/95647?hl=pl\" target=\"_blank\" rel=\"nofollow\">Android</a>\r\n            </li>\r\n            <li><a href=\"https://support.apple.com/pl-pl/HT201265\" target=\"_blank\" rel=\"nofollow\">Safari (iOS)</a>\r\n            </li>\r\n            <li><a href=\"http://www.windowsphone.com/pl-pl/how-to/wp7/web/changing-privacy-and-other-browser-settings\" target=\"_blank\" rel=\"nofollow\">Windows Phone</a>\r\n            </li>\r\n            <li><a href=\"http://docs.blackberry.com/en/smartphone_users/deliverables/32004/Turn_off_cookies_in_the_browser_60_1072866_11.jsp\" target=\"_blank\" rel=\"nofollow\">Blackberry</a>\r\n            </li>\r\n        </ol>\r\n    </li>\r\n</ol>', 'Polityka prywatno≈õci i cookies', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2018-04-27 08:20:58', '2018-04-27 06:20:58', '', 20, 'http://192.168.5.155/coffeenation/bez-kategorii/20-revision-v1/', 0, 'revision', '', 0),
