(45, 1, '2018-05-15 09:57:11', '2018-05-15 07:57:11', '<label> Your Name (required)\r\n    [text* your-name] </label>\r\n\r\n<label> Your Email (required)\r\n    [email* your-email] </label>\r\n\r\n<label> Subject\r\n    [text your-subject] </label>\r\n\r\n<label> Your Message\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Send\"]\n1\nArtixen.net \"[your-subject]\"\n[your-name] <wordpress@192.168.5.155>\nhelpdesk@artixen.net\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Artixen.net (http://192.168.5.155/WPstarter)\nReply-To: [your-email]\n\n\n\n\nArtixen.net \"[your-subject]\"\nArtixen.net <wordpress@192.168.5.155>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Artixen.net (http://192.168.5.155/WPstarter)\nReply-To: helpdesk@artixen.net\n\n\n\nTwoja wiadomo≈õƒá zosta≈Ça wys≈Çana. Dziƒôkujemy!\nWystƒÖpi≈Ç problem z wys≈Çaniem twojej wiadomo≈õci. Spr√≥buj ponownie p√≥≈∫niej.\nJedno lub kilka p√≥l zosta≈Ço niepoprawnie uzupe≈Çnione. Sprawd≈∫ i spr√≥buj ponownie.\nWystƒÖpi≈Ç problem z wys≈Çaniem twojej wiadomo≈õci. Spr√≥buj ponownie p√≥≈∫niej.\nMusisz wyraziƒá zgodƒô na powy≈ºsze zapisy, aby m√≥c wys≈Çaƒá formularz.\nTo pole jest wymagane.\nTo pole jest za d≈Çugie.\nTo pole jest za kr√≥tkie.\nFormat daty jest niepoprawny.\nData jest wcze≈õniejsza, ni≈º pierwsza dozwolona.\nData jest p√≥≈∫niejsza, ni≈º ostatnia dozwolona.\nPodczas wgrywania pliku wystƒÖpi≈Ç nieznany b≈ÇƒÖd.\nNie mo≈ºesz wgrywaƒá plik√≥w tego typu.\nTen plik jest zbyt du≈ºy.\nWystƒÖpi≈Ç b≈ÇƒÖd podczas wgrywania pliku.\nFormat liczby jest niepoprawny.\nTa liczba jest mniejsza, ni≈º minimalna dopuszczana.\nTa liczba jest wiƒôksza, ni≈º maksymalna dopuszczalna.\nOdpowied≈∫ w quizie jest nieprawid≈Çowa.\nWpisany kod jest nieprawid≈Çowy.\nWprowadzony adres e-mail jest nieprawid≈Çowy.\nWprowadzony adres URL jest nieprawid≈Çowy.\nWprowadzony numer telefonu jest nieprawid≈Çowy.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2018-08-13 12:15:42', '2018-08-13 10:15:42', '', 0, 'http://192.168.5.155/WPstarter/?post_type=wpcf7_contact_form&#038;p=45', 0, 'wpcf7_contact_form', '', 0),
